    - type: Paper
      content: >
        Привет, я Фрэнк Баритонос, и я хочу поделиться с вами одной удивительной историей, которая произошла со мной на станции Реликт в далеком 2956 году.


        Когда мне было всего 25 лет, я решил открыть свой собственный бар на новой космической станции Реликт. Это было моё детское желание, и я был готов вложить все свои силы и старания, чтобы осуществить его. Я создал уютное место, где каждый посетитель станции мог отдохнуть после долгого рабочего дня, выпить вкусный коктейль и насладиться приятной компанией.


        Но однажды, когда бар был полон гостей, произошло нечто невероятное. Внезапно на мой бар упал метеорит, разрушив часть стены и вызвав панику среди посетителей. Я был на волоске от смерти, надел аварийную маску и бегом побежал на выход. Хорошо, что среди нас был инженер-дворф Шыло Ухов, он успел поставить барьер.


        Когда я вернулся на место бедствия, я увидел, что мой бар был полностью разрушен. Я сильно расстроился. Ведь это была мечта моей жизни. Я оставил свое снаряжение за стеной и плотно ее заварил , там я и останусь....
