      rot: 3.141592653589793 rad
      pos: 51.606052,-68.49454
      parent: 2
    - type: Paper
      content: >+
        Карл Макендзи был обычным рабочим на станции Реликт, пока однажды он не нашел древнюю реликвию – камень, который, как он уверял, обладал силой бога смерти. Он начал убеждать других рабочих станции в своих сверхъестественных способностях и скоро создал культ, поклоняющийся этому богу.


        Под предводительством Карла, последователи бога смерти начали совершать жертвоприношения, чтобы ублажить своего нового божественного повелителя. Члены культа убивали неверующих и предлагали их как жертвы, утверждая, что это принесет им благословение и защиту от смерти.


        Но однажды все изменилось. Одна из жертв контактировала с внешним миром и просила помощи. Служба безопасности станции быстро разглядели действия культа и отправили вооруженых офицеров, чтобы окончательно раскрыть их деяния.


        Карл Макендзи был арестован и осужден за серийные убийства. Культ бога смерти был разрушен, и рабочие станции с облегчением вздохнули, зная, что теперь они безопасны от безумных верований и жертвоприношений.


        Но легенда о Карле Макендзи и его культе осталась в памяти станции Реликт на долгие годы, напоминая всем о том, как опасно может быть поклонение неизвестным силам.

