        В 2911 году, была построена станция “Реликт”. Она была амбициозным проектом.

        “Реликт” проработала тридцать лет, став довольно важной станцией Nanotrasen, из-за удобного расположения. На ней были проведены многие исследования. Но в 2941 году трагедия ударила по станции. Гигантский метеорит, о котором никто не знал, прилетел в задную часть станции.


        Катастрофа унесла жизни десятка людей, а сама станция была серьезно повреждена. Примерно половину станции разбило и ее обломки улетели далеко в космос, а некоторые остались до сих пор.


        Восстановление “Реликта” заняло 15 лет. Инженеры и Атмос-техники, работая под угрозой метеоритов, укрепили оставшуюся часть станции и обустроили половину станции всем необходимым .




